function WordDictionary({data}){
    const items = [
        {
            title : "Definition:",
            content : data.meanings[1].definitions[0].definition
        },
        {
            title : "Parts of speech:",
            content : data.meanings[1].partOfSpeech
        },
        {
            title : "Synonyms:",
            content : data.meanings[1].synonyms
        },
        {
            title : "Antonyms:",
            content : data.meanings[0].antonyms
        }
    ]
    return(
        <div className="d-flex border">
            <div className="">
                {items.map(item => {return <div className="p-2 pe-3">{item.title}</div>} )}
            </div>
            <div className="">
                <div className="p-2">
                    Parts of speech:
                </div>
                <div className="p-2">
                    Definition:
                </div>
            </div>
        </div>
    )
}
export default WordDictionary;
